import { Box, Button, Container, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Typography, MenuItem, Select, ListItemText, InputLabel, FormControl } from '@material-ui/core';
import React, { useState, useEffect } from 'react';
import { makeStyles } from '@material-ui/core';
import { Link } from 'react-router-dom';
import { Bar } from 'react-chartjs-2';


const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
    },

    // Container: {
    //     marginTop: theme.spacing(2)
    // },
    // box: {
    //     maxWidth: theme.spacing(100)
    // },
    table: {
        minWidth: 650,
    },
    select: {
        minWidth: 200,
        marginBottom: theme.spacing(2),
    },
}));


// const ITEM_HEIGHT = 48;
// const ITEM_PADDING_TOP = 8;
// const MenuProps = {
//     PaperProps: {
//         style: {
//             maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
//             width: 250,
//         },
//     },
// };
export default function Usermoock() {
    const classes = useStyles();
    const [testsapi, setTestsAPI] = useState([]);
    const [selectedCategories, setSelectedCategories] = useState([]);
    const [selectedMonthCreaties, setSelectedMonthCreaties] = useState([]);
    const [selectedYearCreaties, setselectedYearCreaties] = useState([]);

    useEffect(() => {
        fetch('https://script.google.com/macros/s/AKfycbz8n0pUzWpfu4wUA-Y8DDViIZysVgtqpGZ-S1R13EwCcZ3HscBVBPzkO6lZLa11yduE/exec')
            .then((res) => res.json())
            .then((data) => {
                setTestsAPI(data);
                // console.log(data)
            });
    }, []);

    const handleCategoryChange = (event) => {
        setSelectedCategories(event.target.value);
    };

    const handleMonthChange = (event) => {
        setSelectedMonthCreaties(event.target.value);
    };

    const handleYearChange = (event) => {
        setselectedYearCreaties(event.target.value);
    };


    const getUniqueCategories = () => {
        const categories = new Set(testsapi.map(test => test.category_Name));
        return Array.from(categories);
    };

    const getUniqueMonthCreaties = () => {
        const MonthCreaties = new Set(testsapi.map(test => test.month_created));
        return Array.from(MonthCreaties);
    };

    const getUniqueYearCreaties = () => {
        const YearCreaties = new Set(testsapi.map(test => test.year_created));
        return Array.from(YearCreaties);
    };

    const filteredData = testsapi.filter(test =>
        (selectedCategories.length === 0 || selectedCategories.includes(test.category_Name)) && (selectedMonthCreaties.length === 0 || selectedMonthCreaties.includes(test.month_created))
        && (selectedYearCreaties.length === 0 || selectedYearCreaties.includes(test.year_created))
    );

    const calculateTotalStudentsByCategory = () => {
        const totals = {};
        testsapi.forEach(test => {
            if (totals[test.category_Name]) {
                totals[test.category_Name] += test.totalStudents;
            } else {
                totals[test.category_Name] = test.totalStudents;
            }
        });
        // console.log(totals);
        return totals;
    };

    const totalStudentsByCategory = calculateTotalStudentsByCategory();

    const chartData = {
        labels: testsapi.filter(test =>
            selectedCategories.length === 0 || selectedCategories.includes(test.category_Name)
        ).map(test => test.course_Name),
        datasets: [
            {
                label: 'Total Students',
                data: testsapi.filter(test =>
                    selectedCategories.length === 0 || selectedCategories.includes(test.category_Name)
                ).map(test => test.totalStudents),
                backgroundColor: 'rgba(75, 192, 192, 0.6)',
                borderColor: 'rgba(75, 192, 192, 1)',
                borderWidth: 1
            }
        ]
    };

    return (
        <>
            <Container className=' grid grid-flow-col justify-around  max-w-full'>
                <Paper className='w-min h-min' >

                    <Box maxWidth='lg' className={classes.box}>
                        <Box className=' flex justify-evenly  w-60'>
                            <Typography variant='h6'>User</Typography>
                            <Button component={Link} to="/" className='hover:bg-red-600 text-white bg-zinc-600  ' variant='contianed'>
                                Back
                            </Button>
                        </Box>

                        <FormControl sx={{ m: 1, minWidth: 120 }} size="small" >
                            <InputLabel >Category</InputLabel>
                            <Select
                                multiple
                                value={selectedCategories}
                                onChange={handleCategoryChange}
                                displayEmpty
                                className={classes.select}
                                inputProps={{ 'aria-label': 'Without label' }}
                                renderValue={(selected) => selected.length === 0 ? <em></em> : selected.join(', ')}
                            >
                                <MenuItem disabled value="">
                                    <em>None</em>
                                </MenuItem>
                                {getUniqueCategories().map((category) => (
                                    <MenuItem key={category} value={category}>
                                        {/* <Checkbox checked={selectedCategories.indexOf(category) > -1} /> */}
                                        <ListItemText checked={selectedCategories.indexOf(category) > -1} primary={category} />
                                    </MenuItem>
                                ))}
                            </Select>
                        </FormControl>
                        {/* Month */}
                        <FormControl sx={{ m: 1, minWidth: 120 }} size="small" >
                            <InputLabel >Month</InputLabel>

                            <Select
                                multiple
                                value={selectedMonthCreaties}
                                onChange={handleMonthChange}
                                displayEmpty
                                className={classes.select}
                                inputProps={{ 'aria-label': 'Without label' }}
                                renderValue={(selected) => selected.length === 0 ? <em></em> : selected.join(', ')}
                            >
                                <MenuItem disabled value="">
                                    <em>None</em>
                                </MenuItem>
                                {getUniqueMonthCreaties().map((month) => (
                                    <MenuItem key={month} value={month}>
                                        {/* <Checkbox checked={selectedCategories.indexOf(category) > -1} /> */}
                                        <ListItemText checked={selectedMonthCreaties.indexOf(month) > -1} primary={month} />
                                    </MenuItem>
                                ))}
                            </Select>
                        </FormControl>

                        {/* Year */}
                        <FormControl sx={{ m: 1, minWidth: 120 }} size="small" >
                            <InputLabel >Year</InputLabel>
                            <Select
                                multiple
                                value={selectedYearCreaties}
                                onChange={handleYearChange}
                                displayEmpty
                                className={classes.select}
                                inputProps={{ 'aria-label': 'Without label' }}
                                renderValue={(selected) => selected.length === 0 ? <em></em> : selected.join(', ')}

                            >
                                {/* <MenuItem value=''>
                                    <em>None</em>
                                </MenuItem> */}
                                {getUniqueYearCreaties().map((Year) => (
                                    <MenuItem key={Year} value={Year}>
                                        {/* <Checkbox checked={selectedCategories.indexOf(category) > -1} /> */}
                                        <ListItemText checked={selectedYearCreaties.indexOf(Year) > -1} primary={Year} />
                                    </MenuItem>
                                ))}
                            </Select>
                        </FormControl>
                    </Box>

                    <TableContainer component={Paper}>
                        <Table className={classes.table} aria-label="simple table">
                            <TableHead>
                                <TableRow>
                                    {/* <TableCell align="center">Course_ID</TableCell> */}
                                    {/* <TableCell align="center">Year_created</TableCell> */}
                                    {/* <TableCell align="center">Month_created</TableCell> */}
                                    <TableCell align="center">Category_Name</TableCell>
